QuestsSorted.NameClass:
Thread t = new Thread(() =>
{
 uint itemId = 61284;
 int questId = 27453;
 while (robotManager.Products.Products.IsStarted)
 {
  if (Conditions.InGameAndConnectedAndAliveAndProductStartedNotInPause)
  {
   if (!Quest.HasQuest(questId))
    break;
   if (ObjectManager.Target.IsValid && ObjectManager.Target.IsAlive && ObjectManager.Target.HealthPercent <= 50)
   {
    ItemsManager.UseItem(itemId);
   }
  }
  Thread.Sleep(500);
 }
});
t.Start();

Thread t = new Thread(() =>
{
    uint itemId = 61369;
    int questId = 27528;
    while (robotManager.Products.Products.IsStarted)
    {
        if (Conditions.InGameAndConnectedAndAliveAndProductStartedNotInPause)
        {
            if (!Quest.HasQuest(questId))
                break;
            if (ObjectManager.Target.IsValid && ObjectManager.Target.IsDead)
            {
                ItemsManager.UseItem(itemId);
            }
        }
        Thread.Sleep(500);
    }
});
t.Start();

local questId = 27535;
for i=1,GetNumQuestLogEntries() do
 local _, _, _, _, _, _, _, id = GetQuestLogTitle(i);
 if id == questId then
  SelectQuestLogEntry(i);
  SetAbandonQuest();
  AbandonQuest();
 end
end

