public sealed class OnwardtoLightsHopeChapel: QuestInteractWithClass
{
    public OnwardtoLightsHopeChapel()
    {
        QuestId.Add (27373); // Add quest id

        Step.AddRange(new[] { 1, 0, 0, 0 });// Objective required count

        EntryIdTarget.Add(45400); // Entry id of creature/npc at interact with
        GossipOptionNpcInteractWith = 1; // This options is only if npc has menu
        HotSpots.Add(new Vector3(1919.888, -2652.389, 59.9541));
    }
}

